import React, {Fragment, useState} from 'react';

const Lista = () => {
    const [arrayNumero, setNumero] = useState([1,2,3,4,5])
    return (
        <Fragment>
            <h2>Lista</h2>
            {
            arrayNumero.map((item, index) => 
                <p key={index}>{item}-{index}</p>
                )
            }
        </Fragment>
    );
}
export default Lista;
